(77, '2017-04-19', 3, 114, 'Solicita: Susana Urrutia\n Area Emisora: secretaria de turismo\n Observacion: Buen dia:\n\nSolicito se agregue al Permiso PGM, consulta general de fichada, a los agentes que a continuaciòn se detallan, que forman parte del personal de la Direccòn de Trabajo:\n\n- Gabriela Anteanao - Legajo 12912\n\n- Gabriela Torres - Legajo 14836\n\n- Gonzalo Jaquis - Legajo 14833\n\n\nUsuarios: rabarzua - surrutia\n\n\nMuchas gracias.\n\n\nSusana', '', NULL, 1, NULL, NULL, NULL, 38),
(78, '2017-04-19', 3, 114, 'Solicita: Lucas Perez\n Area Emisora: terminal omnibus\n Observacion: buenos días les solicito por este medio tengan a bien poder agregar dentro de mi permiso para ver fichadas a la agente Contreras María Alicia LEG N º 11330  y DÍAZ JORGE EDELIO LEG N º 1181  ya q no puedo visualizar sus ingresos y Salidas\n\ndesde ya muchas gracias los saludo\nATENTAMENTE\n \nLUCAS PEREZ', '', NULL, 1, NULL, NULL, NULL, 38),
(79, '2017-04-19', 3, 110, 'Solicita: Politicas tributarias\n Area Emisora: secretaria de hacienda\n Observacion: Hola ali me podrías decir por favor quien genero estas notas de débito, gracias!!!!!!!!!!!!!! María.\n \n0939313870 \n0939313846 \n0940292465 \n Mensaje de avarano: Las notas de débito las hizo Martín de Tesoreria. Las 1eras dos el 10/01/17 y la 3era el 13/2.\nY si mirás en la ficha de cada factura en la descripción te dice la causa.\nTodas las notas de débito/crédito que hacen referencia a diferencia de importes , por lo general, se hacen en Tesorería , por los pagos electrónicos.\n', '', NULL, 1, NULL, NULL, NULL, 38),
(80, '2017-04-19', 3, 104, 'Solicita: Mercado Comunitario\n Area Emisora: secretaria de hacienda\n Observacion: Buen día,\nsolicitamos tengan a bien dar permisos para entrar al PGM nuevo al usuario\nlanton leg.12350 para poder ver deudas, ordenes de pago, tasa personal y\ncon el PGM viejo poder hacer pedidos de abastecimiento, proyectos de\nresolución y ver resoluciones.\nGracias!\n\n', '', NULL, 1, NULL, NULL, NULL, 38),
(81, '2017-04-19', 3, 27, 'Solicita: Mercado Comunitario\n Area Emisora: secretaria de hacienda\n Observacion: Buen día,\nsolicitamos tengan a bien dar permisos para entrar al PGM nuevo al usuario\nlanton leg.12350 para poder ver deudas, ordenes de pago, tasa personal y\ncon el PGM viejo poder hacer pedidos de abastecimiento, proyectos de\nresolución y ver resoluciones.\nGracias!\n\n', '', NULL, 1, NULL, NULL, NULL, 38),
(82, '2017-04-19', 3, 106, 'Solicita: Ivana Calo\n Area Emisora: secretaria\n Observacion: Hola buen día solicito poder terner acceso al PGM nuevo mi nombre es Ivana Caló Legajo 11713\nactualmente tengo acceso a aprobacion de pedidos de abastecimiento de la Secretaría de Desarrollo Social Cultural y Deportivo que incluye todos los pedids generados en Sociales, Cultura y Deportes\naceesoa  padrón de personas, acceso a realizacion de proyectos de todos los tipos, pase por sistema de todos los proyectos generados en sociales, deportes y cultura. realizacion de pedidos de abastecimiento. y solicito acceso para poder ver las ordenes de pago.\n \natte Ivana. ', '', NULL, 1, NULL, NULL, NULL, 38),
(83, '2017-04-19', 3, 54, 'Solicita: Lucas Perez\n Area Emisora: terminal omnibus\n Observacion: por otra parte vuelvo a solicitarles  enviarme en carácter de URGENTE los movimientos de micros en terminal desde enero de 2016 a la fecha para elevar informe a la SUBSECRETARIA DE TTO. Y TTE. \ndesde ya muchas gracias los saludo\nATENTAMENTE\n \nLUCAS PEREZ', '', NULL, 1, NULL, NULL, NULL, 38),
