(94, '2017-04-21', 18, 110, 'Solicita: Cecilia Cartes\n Area Emisora: dpto. tributario\n Observacion: Solicita modificar estado boleta 0940481666 de Anulado a Adeudado ya que se debe abonar. \nTambien quiere saber quien lo anulo.', '', NULL, 1, NULL, NULL, NULL, 38),
(95, '2017-04-21', 18, 115, 'Solicita: Alicia\n Area Emisora: direccion de sistemas\n Observacion: El talonario 38604 es al que no se le había migrado el item "Serv.Urbano y\nVialidad Rural"  en su cuota nro 4 por $ 709.08 .\nPara solucionarlo en el momento se agregó el item por el "administrador de\ndeuda".\n\nPara estar seguros de que no existan otras diferencias como\nesta,necesitamos que realicen un control de la migración.', '', NULL, 1, NULL, NULL, NULL, 38),
(98, '2017-04-21', 18, 127, 'Solicita: alicia\n Area Emisora: direccion de sistemas\n Observacion:  al realizar un procesa deuda a un bien de tasa por serv.a la\npropiedad , apareció relacionado otro procesa deuda que no tiene nada que\nver, inclusive esta pagado hace años.\n\nAdjunto captura de pantalla de lo sucedido.\n\nSi bien esto no ocasionó mayores problemas, ya que se cobró lo que\ncorrespondía, será conveniente ver que es lo que pasó.\n Mensaje de avarano: Pgm dijo que no sabe que paso , pero Hector descubrio que tiene que ver con los id_process.\nCoincidio id_proces nuevo con alguno ya existente.', '', NULL, 1, NULL, NULL, NULL, 38),
(104, '2017-04-21', 18, 115, 'Solicita: Erica\n Area Emisora: depto de contribuciones\n Observacion: desde el área de contribuciones solicitan el siguiente\nrequerimiento sobre las notificaciones por planes de pago.\nActualmente la notificación tiene los datos del titular del bien y no del\nencargado del plan de pago. Es necesario que la notificacion este a nombre\nde quien sea firmante del plan de pago. Este requerimiento obedece a la\nnecesidad de notificar correctamente a quien tramito el plan de pago.\n\n Mensaje de avarano: Cariquero', '', NULL, 1, NULL, NULL, NULL, 38),
(105, '2017-04-21', 18, 127, 'Solicita: Lilian Baroni\n Area Emisora: direccion de sistemas\n Observacion: Tenemos reiteradas solicitudes de que se pueda volver a estado "Adeudado" \ncuotas que estén en cualquier estado excepto "Cobrado" y "Financiado".', '', NULL, 1, NULL, NULL, NULL, 38),
(106, '2017-04-21', 18, 127, 'Solicita: alicia\n Area Emisora: direccion de sistemas\n Observacion: En el padrón de residuos urbanos, que se liquidan las cuotas considerando\nlos adicionales facturados, aunque la cuota esté pagada, el adicional se\npuede pasar a adicional pendiente y después borrarlo.\nDe esta forma, se pierde el dato de los m3 recolectados.\nSerá posible que, cuando la boleta relacionada al adicional esté pagada,\nel sistema no deja pasar el adicional facturado a pendiente?', '', NULL, 1, NULL, NULL, NULL, 38),
(107, '2017-04-21', 18, 115, 'Solicita: alicia\n Area Emisora: direccion de sistemas\n Observacion: Al hacer un tipo de talonario con tasa de interés 0, y financiar una deuda\nde 31800$ dan 12 cuotas de 2649.99 en lugar de 2650.\nHaciendo lo mismo con el usuario prueba da bien.\nHay alguna configuración que tenga que cambiar?', '', NULL, 1, NULL, '00---------', NULL, 38),
(108, '2017-04-21', 18, 120, 'Solicita: Erica\n Area Emisora: depto de contribuciones\n Observacion: Necesitamos que la ayuda de "Listado de tipos de conexiones por obra"\ndisponible para la realización de reportes muestre el concepto y no solo\nel tipo de conexión, para poder identificar la obra buscada.\nSe utiliza esta ayuda en el reporte "Contr-Listado datos por Obra".', '', NULL, 1, NULL, NULL, NULL, 38),
(109, '2017-04-21', 18, 127, 'Solicita: alicia\n Area Emisora: direccion de sistemas\n Observacion: Una consulta sobre la unificación de personas. En el sistema anterior\ncuando se unificaba, la persona original se borraba de la tabla de\npersonas. Ahora no es asi?\nPorque encontramos unos 450 que suponiamos se debían haber borrado, pero\nsiguen estando.\nAdjunto reporte con los registros encontrados, que saque con el siguiente\nselect:\n\nselect a.tipo_documento,a.documento,\nb.tipo_documento_original,b.documento_original,\nb.tipo_documento_nuevo,b.documento_nuevo,estado,fecha_proceso\nfrom personas a join cambio_clave b on a.tipo_documento =\nb.tipo_documento_original and a.documento = b.documento_original\nwhere  b.documento_original <> b.documento_nuevo\nand estado <> \'P\'\n\n Mensaje de avarano: Ejecutamos el proceso de unificacion a las 15:00 hs, verifique varios \ncasos de las personas cargadas para unificar y no se registraron \nproblemas. No obstante, sigan ejecutando el proceso fuera del horario de \natención al público y sin otro proceso masivo ejecutándose en paralelo, \ntal como me informaron que lo vienen haciendo.\n\n\n', '', NULL, 1, NULL, NULL, NULL, 38),
(110, '2017-04-21', 18, 126, 'Solicita: alicia\n Area Emisora: direccion de tesoreria\n Observacion: En el día de ayer el cajero "garanda" recaudo en una operación una boleta\nde talonario y una cuota de convenio de pago y no se imprimió el duplicado\ndel ticket correspondiente  al convenio. Tampoco salió cuando se hizo la\nreimpresión.\nFaltará alguna configuración?', '', NULL, 1, NULL, NULL, NULL, 38),
(111, '2017-04-21', 18, 115, 'Solicita: alicia\n Area Emisora: depto de contribuciones\n Observacion: Se puede hacer una carátula de talonario, distinta de la estandar, que no\ndetalle los períodos incluído en el plan  y tampoco muestre los importes\noriginal, total financiado anticipo y descuento?\nEsto es porque para cumplir (o casi) con una forma de financiación\nestablecida por resolucion, para obra de cloaca , se hicieron condiciones\nparticulares de financiacion , que incluyen descuentos en el monto a\nfinanciar. De esta manera se llega a montos  similares a los que pagarían\ncon las 12 primeras cuotas sin interés y luego 12, 24 o mas cuotas.(ver\ncorreo del 15/2 asunto nueva obra donde se adjunta resolución).\n Mensaje de avarano: dice Fernando que no se puede, pero hay que resolverlo.', '', NULL, 1, NULL, NULL, NULL, 38),
(112, '2017-04-21', 18, 127, 'Solicita: Lilian\n Area Emisora: hacienda\n Observacion: Se puede hacer un seguimiento de las notificaciones enviadas por el\n"Listado/Notificación de deuda"? Es para saber quienes pagaron la boleta\nde deuda generada en la notificación.', '', NULL, 1, NULL, '0000-2017', NULL, 38),
