(253, '2017-05-11', 21, 136, 'Solicita: Estefania Klein\n Area Emisora: direccion de sistemas\n Observacion: Envié mail a Soporte de PGM:\nHola Matías, envío el probema comentado por teléfono:\n\nCuando queremos cortar un recibo de sueldo de una liquidación abierta, en\nel Padrón de Sueldos --> Historial de Cargos, sólo para algunos legajos,\nnos muestra el siguiente error:\nError del servidor\n500 - Error interno del servidor.\nHay un problema con el recurso que busca y no se puede mostrar.\n\nLo estamos haciendo desde baja de Liquidación por el momento como me\nindicaste.', '', NULL, 1, NULL, NULL, NULL, 38),
(254, '2017-05-11', 21, 136, 'Solicita: Estefania Klein\n Area Emisora: direccion de sistemas\n Observacion: Envié mail a Soporte de PGM:\n\n\nHola Matías, de acuerdo a lo conversado telefónicamente, te envío el\nscreenshot del error que hubo mientras se estaba liquidando Planta\nPermanente.\nCuando estaba al 60% mostró lo que adjunto.', '', NULL, 1, NULL, '00---------', NULL, 38),
(255, '2017-05-12', 21, 136, 'Solicita: Vanesa Noves\n Area Emisora: dpto de sueldos\n Observacion: Hola Hernán, ¿cómo estás?, estuve viendo con Vanesa unos legajos con el\ntema de los hijos Mayores a 18 años. Tengo varios casos.\n\nCASO 1: Los legajos para que mires son: 1531 y 8436 (NOV. 1810)\n\néstos tienen hijos que cumplen 18 años en Mayo, y en la liquidación de\nMayo no los está incluyendo, deberían cobrar por hijos con MAYO inclusive.\n\nCASO 2: Legajo 20604 y 287 tiene a la NIETA/NIETO a cargo y no le está\nincluyendo la novedad 1810.\n\nCASO 3: Legajo 300\n\nTiene un NIETO con Discapacidad y no le incluye la novedad 1920.\n\nPodrás revisar la fórmula CantidadHijosEscolaresMenores18() ?\n\nporque antes era Unidad = Empleado.Hijos y se ve que los NIETOS los\ncargaban como hijos.\n\nMuchas gracias.\n\nSaludos!\nEstefanía Klein\n Mensaje de eklein: Estefanía:\n\nEstá modificada la función para contemplar todos los casos. Por favor reliquiden y\nverifiquen nuevamente cada caso.\n\nSaludos.-\nFernando Gonzalez', '', NULL, 1, NULL, NULL, NULL, 38),
(256, '2017-05-15', 21, 110, 'Solicita: Vanesa Noves\n Area Emisora: dpto de sueldos\n Observacion: Hola, ejecutaron desde sueldos el reporte "Sueld-Resumen Liquidacion por\nLugar de Cobro" con los parámetros:\n\n2017\n05\nPeriodo Mensual\nAPI\n\nY el "Total Gral" suma TODOS los NETO, no sólo los "TOTAL" como debería,\nlo corrí con otros parámetros y hace lo mismo, por ejemplo:\n\n2017\n04\nPeriodo Mensual\nPlanta, Contratados, politicos\n\nNo sé si ésto sucederá con todos los reportes. Necesitamos que la suma sea\nla correcta ya que los resportes se envían a otras áreas.\n\nSaludos\nEstefanía', '', NULL, 1, NULL, NULL, NULL, 38),
