(309, '2017-05-29', 18, 137, 'Solicita: berenice\n Area Emisora: politicas tributarias\n Observacion: Alicia,\nNecesito que la cuota 03 de la cta. Nº 15939 (0935456422) que tiene orden de no pagar me aparezca en el PGM como adeudada.\nY lo mismo para la cuota 02 y 03 de  cta. Nº 15938 (0935456309) que no se debitaron por falta de fondos, necesito que aparezcan en PGM como adeudadas.\nTengo que computar unas notas de crédito que genere y ya corregí de acuerdo a lo que me informaste. \nGracias\n\n Mensaje de avarano: Las cuotas cobradas no se pueden volver a adeudadas, en ningún caso.\nPor eso se cargan las cuotas DÉBITO INCIDENCIA EN ACREDITACIÓN ,    para generar nuevamente la deuda, en estos casos en que el sistema las dió, erroneamente,  por cobradas.\n\nPara utilizar las notas de crédito tenés que seleccionar esas cuotas.\n\nEn el caso de estos padrones, Pgm Córdoba tiene que generar todavía los DÉBITOS INCIDENCIA EN ACREDITACIÓN  correspondientes a la cuota 3/2017, para volver a generar la deuda.\nDurante la mañana de hoy te confirmo cuando lo harán.\n', '', NULL, 1, NULL, NULL, NULL, 38),
