(320, '2017-05-31', 21, 110, 'Solicita: Estefania Klein\n Area Emisora: Direccion de Sistemas\n Observacion: Hola, necesitamos por favor si nos pueden modificar el reporte que se saca\ndesde:\n\nSueldos y Jornales --> Orden de Pago --> Vinculación de Sueldos con\nContabilidad el reporte: "ERRORES VINCULACION DE SUELDOS CON CONTABILIDAD"\n\nQue saque el reporte del estilo:\n\nArea Administrativa / Codigo de la novedad numérico / Concepto Novedad\n\nY que no lo duplique por cada empleado.\n\nDe ésta forma facilitamos el trabajo del Dpto. de Sueldos cuando llega la\nhora del cierre.\n\nDesde ya muchas gracias.\n\nEstefanía\n Mensaje de eklein: Estefanía:\n\nEs correcta la observación. Se elaboró la solicitud de requerimiento respectiva para\nsu desarrollo. Informaremos al respecto cuando tengamos novedades de actualización.\n\nSaludos.-\n\nIng. Fernando M. Gonzalez\nConsultor Senior\nProgram Consultores S.A.\nJuan del Campillo 779\n(X5000GTO) Cordoba - Argentina\nTel/fax (0351) 4474200 y rotativas\nWeb.Site: www.municipalidad.com', '', NULL, 1, NULL, '00---------', NULL, 38),
