(322, '2017-05-31', 21, 66, 'Solicita: Gloria Vera\n Area Emisora: Departamento de Sueldos\n Observacion: El Reporte Sueld-Listado de Aportes incluye API (1301-1306) y no debería.', '', NULL, 1, NULL, NULL, NULL, 38),
(323, '2017-05-31', 21, 121, 'Solicita: Fabiana Velazquez\n Area Emisora: Departamento de Sueldos\n Observacion: Hola Alejandro, te cuento lo que pasó:\n\nLe pregunté a Gloria de Sueldos, ayer ella corrió el proceso de\n"Vinculación de Sueldos con Contabilidad" y le dió los siguientes montos:\n\nPlanta: 54904478.17\nContratados: 11632688.99\nPoliticos: 4275703.96\nPasantes: 70892.10\n------------------------\nTotal 70883763.22 (coincide con la suma de Aportes en Totales por concepto)\n (ADJUNTO ARCHIVOS)\n\nEl tema es que hace media hora yo lo corrí nuevamente para ver si me daba\ndiferencias y si el problema estaba en la vinculación, pero me dieron los\nmismos montos, conclusión el problema no estaba en la vinculación a menos\nque no funcionara bien el proceso.\n\nEl reporte Sueld-Listado de Aportes, tengo entendido que es un reporte\nnuevo que pidió Contaduría a PGM para poder discriminar de la IMPUTACION\ndel NETO, los aportes.\n\nEstuvimos corriendo este reporte toda la mañana y fue cambiando los\nvalores, dando distinto de ayer, el tema es que ni en sueldos ni nosotros\nestuvimos cambiando cosas.\nLo único que hicimos fue correr el proceso de vinculacion nuevamente, y\nluego dió bien ese reporte, pero si hubiese sido eso, me tendrían que\nhaber dado distintos los valores de Totales Contabilidad Presupuesto.\n\nNos gustaría tener un informe de qué sucedió realmente, ya que desde aquí\nno logramos detectar cuál fue el problema.\n\nDesde ya muchas gracias y quedamos a la espera.\n\nSaludos\nEstefanía\n\n> Hola Alejandro, te envío el listado de aportes que sacaron ayer que\n> coincidían los montos, si comparás con los montos de Planta y Contratados,\n> hay diferencias con el reporte que saca ahora.\n>\n> Según los de sueldos no han tocado nada.\n>\n> Ayer se hizo una vinculación de una novedad nueva - Aportes patronales -\n> Novedad 4230, creo que el tema está ahí.\n>\n> Hoy necesitan enviar los informes a contaduría para hacer las órdenes de\n> pago al banco.\n>\n> Quedo a la espera.\n> Muchas gracias!\n> Estefanía\n>\n>\n', '', NULL, 1, NULL, '00---------', NULL, 38),
(324, '2017-05-31', 21, 127, 'Solicita: Estefania Klein\n Area Emisora: Direccion de Sistemas\n Observacion: Hola, necesitamos si nos pueden actualizar la base del usuario "prueba"\ncon el backup del día 30 de Mayo de 2017.\n\nDesde ya muchas gracias.\n\nSistemas\n', '', NULL, 1, NULL, NULL, NULL, 38),
(325, '2017-05-31', 21, 121, 'Solicita: Estefania Klein\n Area Emisora: Direccion de Sistemas\n Observacion: El 30/05/2017 a las 10:32, Consultas Municipalidad Bariloche escribió:\n> Hola Fernando/Hernán:\n> Estamos vinculando una novedad y necesitaríamos si nos pueden hacer\n> opciones en Area Administrativa para el próximo mes.\n> Por ejemplo, hay novedades que se imputan para todos los Contratados a una\n> sola cuenta, o para todos los Políticos/Planta, no se discriminan por área\n> administrativa.\n>\n> Estaría bueno tener opciones por tipo de empleado por ejemplo:\n>\n> Todas Contratados\n> Todas Politicos\n> Todas Planta Permanente\n> Todas API\n> Todas Pasantes\n>\n> Y que "Todas" NO incluya las que dicen INACTIVA.\n>\n>\n> Muchas gracias.\n> Saludos\n> Estefanía\n>\n> Sistemas', '', NULL, 1, NULL, NULL, NULL, 38),
(326, '2017-05-31', 21, 121, 'Solicita: Gloria Vera\n Area Emisora: Departamento de Sueldos\n Observacion: Hola, cuando corren desde sueldos el proceso de inicio de novedades, llega\nhasta cierto porcentaje, luego aparece el cartel que dice que en proceso\nha finalizado y cuando se le da aceptar, completa la barra de progreso al\n100%.\n\nQuisiera saber si este proceso se termina de ejecutar correctamente aunque\nno llegue la barra al 100%.\n\nAdjunto screenshots.\n\nSaludos\nEstefanía\n28/07/17 Mensaje de eklein: Aparentemente el proceso funciona bien, l oque no funciona es la barra, quedo a la espera que Gloria me confirme\nsi este mes le anduvo.\nEstefanía', '', NULL, 1, NULL, '00---------', NULL, 38),
