(350, '2017-06-09', 18, 137, 'Solicita: alicia\n Area Emisora: sistemas\n Observacion: Tenemos problemas con el envío de datos de TALONARIOS a entidades\nexternas, ya que no se puede realizar ningún pago.\n\nLINK:\nEn el archivo de exportación de datos no aparece el código de pago link.\n\nAl intentar pagarla , si el talonario es de tasa por servicio municipal\nsólo aparece el importe de la cuota de tasa por servicio municipal.\n\nSi el talonario es de otra tasa u obra, aparece el siguiente mensaje. " Se\nha ingresado un código de pago inválido"\n\nBANELCO:\nEl archivo si tiene el código, pero no está disponible para pagarlo en\nPago Mis cuentas.\n\nSi el talonario es de tasa por servicio municipal sólo aparece el importe\nde la cuota de tasa por servicio municipal .\n\nSi el talonario es de otra tasa u obra, aparece el siguiente mensaje\n"No encontramos la factura indicada. Por favor verificá que: la factura\nesté dentro de los vencimientos a pagar permitidos por la empresa o que no\nhaya sido abonada con anterioridad (Consultá la sección Comprobantes). "\n Mensaje de avarano: program modifico el proceso', '', NULL, 1, NULL, '00---------', NULL, 38),
