(356, '2017-06-12', 18, 110, 'Solicita: Sergio\n Observacion: preguntar si los pagos son despues del vencimiento o boloetas originales que las genere fisca la impresion\n\n\nTenemos varios contribuyentes que tienen 50 o más cuentas de tasa por serv. a la propiedad y pagan por transferencia. Para recaudarlo, en tesorería imprimen las boletas mediante el procesa deuda. Generan todas las boletas pero al imprimir con la lupa solo hace el pdf para 11 boletas y las demás dan error. Entonces para imprimirlas hay que ir tildando y destildando del listado de boletas de deuda para poder imprimir todo.\nEse es un nro. determinado por el sistema, puede modificarse?', '', NULL, 1, NULL, '00---------', NULL, 38),
