(373, '2017-06-22', 31, 225, 'Solicita: 1706211403\n Area Emisora: Terminal de Omnibus\n Observacion: A:Dirección de Mantenimiento\n\nCC:Jefe de Terminal de Ómnibus MSCB\n \nDirección de Mantenimisnto\nPor la presente solicitamos la revisión del puesto de Informes deTerminal de Ómnibus, ubicado en sala de espera sector central, a fin de realizar mejoras y repaciones varias:\n \nElectricidad\nPor favor verificar la instalación eléctrica de dicho puesto (estado y seguridad), tener en cuenta que necesitamos un toma para enchufar pc, celular y otro para eventualmente en invierno conectar un caloventor o pava electrica. \nQuiero comentarles al respecto de los tomas a la vista del público, tenemos el inconveniente que cuando el personal de Informes no está en el puesto, los pasajeros que esperan se meten en el puesto a enchufar sus celulares. \nTener en cuenta además la necesidad de mejora de la iluminación sobre el puesto ya sea agregando o cambiando tubo fluorescente de luz sobre dicho puesto (tubo mediano fino). \nVer además, estado actual de cable telefónico y ficha de conexión a internet en puesto (factibilidad de conexión a internet si hubiera).\n \nDesde ya muchas gracias, aguardo sus comentarios. \nAtentamente.\n  \nLic. Verónica Martin a/c\nDepartamento de Informes y Atención al Turista\nSecretaría de Turismo y Producción\nMunicipalidad de San carlos de Bariloche\ninformesturmscb@bariloche.gov.ar\nTE (0294) 4625508\n \n \n\n Mensaje de farroyo: corresponde a OT3653\n', '1100', NULL, 1, NULL, '0228-DMI-17', NULL, 9185),
(374, '2017-06-22', 31, 145, 'Solicita: 1706211403\n Area Emisora: Terminal de Omnibus\n Observacion: A:Dirección de Mantenimiento\n\nCC:Jefe de Terminal de Ómnibus MSCB\n \nDirección de Mantenimisnto\nPor la presente solicitamos la revisión del puesto de Informes deTerminal de Ómnibus, ubicado en sala de espera sector central, a fin de realizar mejoras y repaciones varias:\n \n\nCarpintería\nAsimismo solicitamos la reparación y mejora del mueble mostrador de dicho puesto, el mismo tiene un estante caído, falta de barniz y pintura blanca en mal estado. Por favor verificar el estado de dicho mueble e informar los materiales necesarios requeridos a fin de gestionar su pronta reparación.\n \n\nDesde ya muchas gracias, aguardo sus comentarios. \nAtentamente.\n  \nLic. Verónica Martin a/c\nDepartamento de Informes y Atención al Turista\nSecretaría de Turismo y Producción\nMunicipalidad de San carlos de Bariloche\ninformesturmscb@bariloche.gov.ar\nTE (0294) 4625508\n \n \n\n Mensaje de farroyo: corresponde a OT3656\n', '', NULL, 1, NULL, NULL, NULL, 9185),
