(646, '2017-07-27', 21, 110, 'Solicita: Claudia Inalaf\n Area Emisora: Departamento de Sueldos\n Observacion: Buenas tardes: \n                        a continuación se detalla legajos que contenían  las novedades 3660 (deducciones)–Obra Social Soyem (Jubilados y novedad 2140 (deducciones) -Soyem Obra Social Fam. Legajos: 332, 395 y 619. Los mismos en el mes de Junio quedaron con saldo negativo en el periodo de Horas Extras, volviéndose a repetir dicho error en el periodo Julio 2017.-\n                        De esta situación surgía la diferencia cuando se emitía el Listado de Aportes, en la columna de Total_Imputación_Neto. No coincidiendo con la OP General de Horas Extras.\n                        Por lo expuesto anteriormente solicito se revean dichos códigos para evitar próximas diferencias.\n                        Muchas Gracias\n                        Claudia \n Mensaje de eklein: > Estefanía:\n> Para controlar los netos negativos configuramos un código de novedad de\n> deducción 40001-CONTROL NETO NEGATIVO, que controla la liquidacion e\n> informa un error para todos los sueldos cuyo importe neto quedó negativo.\n> Deben agregarla masivamente a todos los tipos de liquidación y cuando\n> hacen el proceso de liquidación visualizar siempre los errores para\n> controlar, luego corregir y volver a liquidar.\n> Saludos cordiales.-\n> Saludos.-\n> Ing. Fernando M. Gonzalez\n\nHola Fernando, gracias, no sabía que estaba ésa novedad, igualmente en\neste caso no nos sirve, ya que ellos deben dejar cargadas éstas novedades,\nsino las tienen que borrar y volver a cargar todos los meses, además son\ndeducciones nada más, si no tiene nada en Remunerativos, no los debería\nliquidar directamente, por eso pedía que revisen el proceso de liquidación\nde horas extra.\n\nSaludos\nEstefanía', '', NULL, 1, '0000---------', '00---------', NULL, 38),
