(675, '2017-08-01', 63, 157, 'Solicita: Virginia\n Area Emisora: Prensa y Protocolo\n Observacion: A: Mantenimientos \nSr.  Fernando Arroyo\n\n\nEn referencia a la nota adjunta solicitada por su área, TARIMA SALA DE PRENSA,\nle informo que en material ya está disponible  para comenzar, la misma se encuentra en el área del aserradero.\n Se solicita que se pongan en contacto para el traslado y nos mantengan informados. \n\nSaludos \n\nVirginia Cayún \nAdministración – DGC \n(294)  4436330 - 154504328 \nwww.bariloche.gov.ar\n\n\n\n\n\n    \n\n\n\n02/08/17 Mensaje de farroyo: A: Dirección General de Comunicación.\nDE: Dirección de Mantenimiento e Infraestructura.\nRef.: S/ materiales construcción de tarima Sala de Prensa.\nOrden de Trabajo Nº 1890.\nDe mi mayor consideración:\nPor medio de la presente, para construir una tarima de\n4,83 x 2,80 mts que será destinada a la Sala de Prensa, se solicita la provisión\nde los siguientes materiales:\n? 37 Tablones de Ciprés de 1ª calidad de 2 x 8 x 3 mts.\n? 9 Tablones de 2 x 6 x 3 mts.\n? 300 Tornillos 22 – 70.\n? 2 Lijas de bandas de 100 x 6, 10 Nº 80.\n? 2 Lijas de bandas de 100 x 6, 10 Nº 60.', '', NULL, 1, '1707-310856', '00---------', 76, 9185),
