(685, '2017-08-02', 31, 215, 'Solicita: Veronica Martin\n Area Emisora: Turismo centro Cívico\n Observacion: Departamento de Mayordomía\nPor la presente informamos falta de funcionamiento luces de recova en exterior Edificio Ex Correo, Centro Cívico y sobre calle Independencia. La galería de edificio Ex Correo y la calle Independencia están completamente oscuras durante la mañana-tarde- noche.\nRecordamos que en ocasión a la Fiesta Nacional de la Nieve, habrá una serie de actividades en Centro Cívico hasta el domingo 6/08/17  y es importante que toda la zona se encuentre iluminada, por el alto tránsito de personas y seguridad de las mismas.\n \nDesde ya muchas gracias.\nDepartamento de Mayordomía\nPor la presente informamos falta de funcionamiento luces de recova en exterior Edificio Ex Correo, Centro Cívico y sobre calle Independencia. La galería de edificio Ex Correo y la calle Independencia están completamente oscuras durante la mañana-tarde- noche.\nRecordamos que en ocasión a la Fiesta Nacional de la Nieve, habrá una serie de actividades en Centro Cívico hasta el domingo 6/08/17  y es importante que toda la zona se encuentre iluminada, por el alto tránsito de personas y seguridad de las mismas.\n \nDesde ya muchas gracias.\nLic. Verónica Martín a/c\nDepto. de Informes y Atención al Turista\nSecretaría de Turismo y Producción\nMunicipalidad de San Carlos de Bariloche\ninformesturmscb@bariloche.gov.ar\nTE (0294) 4428675\n', '', NULL, 1, '1708-021057', NULL, 77, 9185),
