(711, '2017-08-03', 21, 110, 'Solicita: Fabiana Velazquez\n Area Emisora: Departamento de Sueldos\n Observacion: Buen día Estefanía, necesitaría que entre las opciones para imprimir los recibos, se encuentre una que se llame \n"Recibos con ART" y que pueda imprimir los recibos de las personas que están con ART, es decir debe leer cualquiera de los siguientes códigos:\n22013\n22014\n32000\n32001\n33000\n33001\n \nDebemos remitirlos al Depto.de Personal todos los meses.\nEspero tus comentarios.\nMuchas gracias,\n  \nFabiana VELAZQUEZ\nA/C Departamento de Sueldos\n\n03/08/17 Mensaje de eklein: Estefanía:\n\nPara obtener los legajos a imprimir con ART deben ejecutar el "Listado \nde Novedades por Período" incluyendo todos los tipos de liquidación y \nlas novedades indicadas en el mail.\n\nCon ese listado obtienen los legajos que luego deben imprimir \nindividualmente (para junio por ejemplo son 14 legajos).\n\nSaludos.-\n\nIng. Fernando M. Gonzalez\n\n-----------------\nHola Fernando, actualmente están utilizando ese listado, pero después\ntienen que buscar de a uno en el pdf para imprimir el duplicado, este mes\nson 14, el mes que viene pueden ser 100, sólo tendrían que agregar un\nfiltro en la impresión de recibos que genere el pdf de los que tienen ART\nnada más, en su momento, en el PGM viejo lo teníamos, lo hizo Mati, y les\nagilizaba bastante el cierre del mes.\n\nFabiana me pidió por favor, porque vienen trabajando bastante atrasados\ntodos los meses con el cambio de sistema y la forma en que hacen las\ntareas hoy en día.\n\nSaludos!\n', 'eklein', NULL, 1, '0000---------', '00---------', NULL, 38),
