(1071, '2017-09-20', 21, 110, 'ENVIE a PGM l oque me transmitió Fabiana por teléfono:\n\nHola, me llamaron desde Sueldos retransmito lo que sucedió:\n\nHicieron el proceso de inicio de novedades como todos los meses.\n\nLuego comenzaron a cargar las Horas Extras nuevas.\n\nSe dieron cuenta que quedaron cargadas las Horas Extras pagas el periodo\nanterior, a pesar de que indicaron que eran "Sólo un periodo".\n\nEvidentemente el proceso de inicio de novedades no estaría funcionando\nbien, ya hace meses que pedimos lo de la novedad 5000, y no obtenemos\navances, y ahora no funciona al parecer, el de horas extras.\n\nEl problema es que ahora tienen que borrar absolutamente todo, y hacer un\nretrabajo de horas extras y ésto afecta las fechas de pago de los sueldos.\n\nPor el momento lo solucionamos desde Novedades Masivas, borrando por\nnovedad, lo cual lleva un tiempo.\n\nQuedo a la espera de una solución.\n\nAtte. Estefanía (Sistemas MSCB)\nSolicita: Fabiana Velazquez\nArea emisora: Departamento de Sueldos\n\n20/09/17 Mensaje de eklein: Hablé con CBA, el próximo inicio de novedades de horas extra, lo vamos a hacer junto con CBA para ver si hay algún problema.\n20/09/17 Mensaje de eklein: Buen día, por medio de la presente informo a Uds. que las horas extras cargadas en el mes de agosto, a pesar de haber sido cargadas como "sólo un período", se repitieron en el mes de setiembre.\nComo ejemplo adjunto impresión de las novedades individuales de un legajo donde se observa:\nCOD.11737 horas extras julio al 50% cargadas con haberes agosto.\nCOD:11738 horas extras agosto al 50% cargadas con haberes setiembre\n \nAsí mismo informo que esta situación nos ocasionó serios problemas en el transcurso normal del trabajo, ya que recien pudimos ver  las novedades replicadas una vez cargadas todas las horas extras del mes (unas 600 planillas aprox.), y luego por sugerencia de la Dirección de Sistemas debimos borrar todas las novedades, las del mes anterior y las de este mes; lo que conlleva recarga de tareas en un área donde, el trabajo es muchísimo y los recursos humanos insuficientes y sin posibilidades de tener más personal por no tener espacio físico.\n \nComo cuando ocurren estos inconvenientes, siempre se tiende a pensar que la gente que hace el trabajo lo hace mal, quiero aclarar que el proceso se realizó de la misma forma en que se viene haciendo desde hace por lo menos 5 años, y que de haber ocurrido durante el proceso algo distinto a lo habitual o si hubiera "aparecido" algún cartel de advertencia, hubieramos hecho la correspondiente consulta a la Dirección de Sistemas.\n \nPor último, agradecería me informen cual fue el problema, ya que la carga de novedades con "sólo un período" se utiliza todos los meses con la mayoría de las novedades, y necesitamos estar seguros de que las mismas no se dupliquen, a fin de evitar serios problemas en la liquidación de sueldos.-\n \n \nAtte.\n \n \n \nFabiana VELAZQUEZ\nA/C Departamento de Sueldos\nRES.2516-I-2012\nMSCB\n20/09/17 Mensaje de eklein: Hola Fabiana, hablé con Córdoba y me dijeron que el proceso hasta ahora ha funcionado bien y no se ha tocado nada.\n \nQuedamos en que, como no tienen forma de ver qué pasó ahora, él próximo mes, antes que realicen el inicio de novedades de horas extras, nos llamen y lo hacemos nosotros con Córdoba para corroborar si funciona bien.\n \nCon respecto al chequeo, pueden corroborar la limpieza de las novedades viejas, desde Novedades Individuales, con algunos legajos seleccionados, sin necesidad de cargar previamente todas las nuevas horas extra y realizar la liquidación para hacer el chequeo, creando ésto un trabajo en base a algo no corroborado previamente, entiendo que deberían haberse borrado las novedades del mes pasado, pero el chequeo lo pueden realizar igualmente, previo a la carga de las novedades nuevas, ya que el inicio de novedades borra dentro de cada novedad individual.\n \nQuedamos a la espera de su aviso la próxima vez que tengan que realizar horas extra, ya que es la única manera de corroborar su correcto funcionamientom según PGM.\n \nSaludos\n \nEstefanía\n(Sistemas - Interno 140)\n', '', NULL, 1, '0000---------', '00---------', NULL, 38);
