(2388, '2017-10-19', 21, 128, 'Estefanía:\n \nEn el legajo de la referencia, liquidando los haberes del mes en curso , hemos podido observar que la fecha de nacimiento de la agente fue modificada y el CUIL borrado.\nEste mes Claudio cargó el COD.02421 y 02422.; pero no parece razonable que eso pueda provocar dicha modificación.\nAl cierre del mes de setiembre la información estaba correcta, te envío arch.enviado a Horizonte con la información de ART. (COD.04120 resaltado en verde).-\nA los efectos de poder saber que ocurrió solicito una auditoría.\nMuchas gracias,\n \nSaludos,\nFabiana\n \nFabiana VELAZQUEZ\nA/C Departamento de Sueldos\nRES.2516-I-2012\nMSCB\nSolicita: Fabiana Velázquez\n\n19/10/17 Mensaje de eklein: Bueno, estaba consultando acá, y me dice Ali que en el PGM viejo, si la persona tenía legajo asociado, no se podís modificar desde el Padrón de Personas, es un chequeo que habían puesto desde acá. El PGM Nuevo parece que no tiene ése chequeo, entocnes cualquier persona que tenga acceso a la ficha de modificación del Padrón de Personas, puede tocar ésos datos.\nPor lo tanto la auditoría la tengo que hacer por todos los usuarios de PGM, ésto me va a llevar unos días, en cuanto lo tenga te lo mando.\n \nSaludos!\nEstefanía\n(Sistemas - Interno 140)', '', NULL, 1, '0000---------', '00---------', NULL, 9191),
