(2435, '2017-10-27', 18, 110, 'No se puede hacer reintegro de pagos con retenciones\nConsultan de Tesorería cómo hacer en los casos en que hacen un pago con cheque y su respectiva retención y tienen que hacer después un reintegro, por diversas razones como que se venció el cheque o necesitan pagar en efectivo.\nEl sistema no deja hacer reintegro si el pago tiene retenciones.\nSolicita: Gaby\n\n27/10/17 Mensaje de avarano: Consulte a Pgm', '', NULL, 1, '0000-2017', '0000-2017', NULL, 9192),
(2436, '2017-10-27', 21, 110, 'Informaron nuevamente que se han borrado fechas de nacimiento en el padrón.\nSolicita: Gloria Vera\n\n27/10/17 Mensaje de eklein: Se envió mail de pedido a PGM: \nHola Fernando, ¿cómo estás?, tenemos un tema con la modificación y\nunificación de personas.\n\nEn el PGM viejo, si una persona era empleado municipal, sólo Sueldos podía\nmodificarla/unificarla.\n\nAhora cualquiera que tenga acceso a cualquiera de ésos módulos, puede\ntocar la persona empleado. Tuvimos ya varias situaciones éste mes de\nunificaciones mal hechas sobre empleados municipales, borrando el CUIL,\nfechas de nacimiento, etc, que son datos importantes a la hora de liquidar\nel sueldo.\n\nNecesitamos 2 cosas:\n\n1) En principio, si pueden poner en la ficha del Padrón de Personas una\nETIQUETA, que en caso de que la persona tenga LEGAJO asociado, diga que es\n"EMPLEADO MUNICIPAL", de ésta manera, visualmente, ya sabrían que sólo lo\ntoca sueldos.\n\n2) Como segunda instancia, sería que se implemente el bloqueo, como estaba\nen el PGM viejo, que toda persona que tenga Legajo asociado, sólo sea\nmodificable por el dpto. de Sueldos.\n\nQuedamos a la espera de una respuesta.\n\nGracias\nSaludos!\nEstefanía\n\n', '', NULL, 1, '0000-2017', NULL, NULL, 9191),
(2437, '2017-10-27', 21, 136, 'Si el empleado tiene una antigüedad menor a 1 año, en el recibo de sueldo le pone Antigüedad -90 años\nSolicita: Gloria Vera\n\n30/10/17 Mensaje de eklein: Estefanía:\n\nSe modificó la novedad de antiguedad para tener en cuenta que se el \nacumulador de años es menor a cero lo tome en cero. Está listo, lo deben \nverificar en la próxima liquidación.\n\nSaludos.-\n\nIng. Fernando M. Gonzalez\nConsultor Senior\nProgram Consultores S.A.', '', NULL, 1, '0000-2017', NULL, NULL, 9191),
