(2531, '2017-11-02', 21, 110, 'Envié mail a PGM:\n\nHola, tuvimos un problema con el campo de OBSERVACIONES,en el "Padrón de Obra de Pavimento" la cuenta es la 911018085.\n\nLuego del corte de sistema del día de la fecha, desde contribuciones cargaron una nueva observación. El problema está en que en lugar de sólo CONCATENAR las nuevas observaciones, además se borraron 3 renglones que había cargados anteriormente, luego de "09/05/13:", miré en un backup y el anterior decía lo siguiente:\n\n"50% DE 32,64 MTS.DE FTE.  26/07/10: SE INFORMO MONTO A LA ESCRIB. AGUILAR: $ 7.200 CON VALIDEZ AL 20/08/10 INCLUSIVE.-  03/09/12:SE INFORMO MONTO A LA ESCRIB.AGUILAR: $ 12.258,20  - 15% DESC. (-$ 1.838,73) TOT.A PAGAR: $ 10.419,47 CON VALIDEZ AL 07/09/12 INCLUSIVE.- (SE ENTREGO RBO.A ESCRIB.)  09/05/13: "CORRESPONDE EXPEDIR CERTIFICADO DE LIBRE DEUDA, EN BENEFICIO DEL SR. GUSTAVO CARLOS LOPEZ, SIEMPRE QUE NO ADEUDE TASAS Y/O CONTRIBUCIONES Y/O DERECHOS Y/O IMPUESTOS MUNICIPALES DEVENGADOS A PARTIR DEL MES DE JUNIO 2004" SEGUN DICTAMEN Nros.20 Y 50/2013 DE ASESORIA LETRADA.- ANTECEDENTES ADJUNTOS AL PLAN DE PAGO 3846 (30 FOJAS)  "\n\n\nAHORA dice:\n\n"50% DE 32,64 MTS.DE FTE. 26/07/10: SE INFORMO MONTO A LA ESCRIB. AGUILAR: $ 7.200 CON VALIDEZ AL\n20/08/10 INCLUSIVE.- 03/09/12:SE INFORMO MONTO A LA ESCRIB.AGUILAR: $ 12.258,20 - 15% DESC. (-$\n1.838,73) TOT.A PAGAR: $ 10.419,47 CON VALIDEZ AL 07/09/12 INCLUSIVE.- (SE ENTREGO RBO.A\nESCRIB.) 09/05/13: ----------(aca se cortó el texto)-----------\n01/11/17: SE EXTIENDE LIBRE DEUDA APTO P/ESCRITURAR A LA ESCRIB. CHAVES S/CERTIF. Nro. 2557/2017.-\n(VISTO C/ERICA).- TIT.: LOPEZ GUSTAVO CARLOS.- OPERACION: DONACION Y CONSTITUCION DE USUFRUCTO.-\nFOTOC. DE DICTAMENES 20 Y 50/2013 ADJUNTOS AL CERTIF. DE LIBRE DEUDA.-\n********** Usuario: MHERRERA - Fecha: 02/11/2017 12:30:21 PM **********"\n\n\n\nNecesitaría que agreguen los renglones que se borraron por favor y mantener los nuevos comentarios, menos el que dice "PRUEBA".\n\nAdemás necesitaríamos un informe de lo sucedido por favor.\n\nDesde ya muchas gracias.\n\nEstefanía\n\nSolicita: Marta Herrera\n', '', NULL, 1, '0000-2017', '0000-2017', NULL, 9187),
