(2655, '2017-11-09', 21, 366, 'Hola Hernán, Vanesa de sueldos vió con vos en su momento ésta fórmula. (CantidadHijos_dis)\n\nTiene un tema con las fechas de los certificados, que si el certificado está dentro del período que se está liquidando, no le liquida la novedad 1920 por ejemplo.\n\nEste mes fue con el legajo 640, no le liquidó la novedad en Octubre.\n\nSi no entiendo mal, la fórmula toma el último día del periodo y sólo devuelve 1 (hijo disc.) si la fecha del certificado es la misma.\nEn este caso como el último día fue 31/10 y el certificado 30/10, no funcionó.\n\nCómo deben utilizar ésta fórmula? Por más que el certificado diga por ejemplo 15/10/2017 deben cargarlo con el último día del mes para que lo liquide? Porque sería el periodo INCLUSIVE.\n\nSaludos\nEstefanía\nSolicita: Vanesa\n\n10/11/17 Mensaje de eklein: Fernando modificó la funcion CantidadHijos_dis para que tome dentro del periodo el certificado si corresponde, y no sólo si es la última fecha del periodo.\nPor ejemplo, si vence el 16/10/2017 y el periodo a liquidar es Octubre/2017, que la incluya en ésa liquidación, la última.\n16/11/17 Mensaje de eklein: Fernando arregló la fórmula, estoy a la espera de la prueba de Vanesa', '', 480, 1, '0000-2017', '0000-2017', NULL, 9191),
